import styled from 'styled-components';

export const StyledStartButton = styled.button`
    box-sizing: border-box;
    margin: 0 0 20px 0;
    padding: 20px;
    min-height: 30px;
    width: 100%;
    border-radius: 20px; 
    border: 4px solid blck;
    color: black;
    background: pink;
    font-family: Georgia
    font-size: 1rem;
    outline: none;
    cursor: pointer;
`
